//   return (
//     <>
//       <p>
//         <strong>skill Name </strong>
//         {skill_name}
//       </p>
//     </>
//   );
// };


function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route exact path="/" component={Search}/>
          <Route exact path="/results/:skill_name1/:skill_name2/:skill_name3" component={Result} />
          {/* <Route exact path="/results/:skill_name/:skill_name" component={Result} /> */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
